import React from 'react';
import { Card, Row, Col, Container } from 'react-bootstrap';
import '../courses/courses.styles.css';

import java from './asset/java_1.png';
import selenium from './asset/selenium.png';
import appium from './asset/Appium.png';
import cucumber from './asset/cucumber.png';
import manual from './asset/ManualTesting.png';
import oracle from './asset/oracle.png';
import python from './asset/python.jpg';
import webservices from './asset/web_services.png';

class Course extends React.Component{
    constructor(){
        super()
        this.state = {
            images:[{id:0,name:java,title:'Java'},
                {id:1,name:selenium,title:'Selenium'},
                {id:2,name:appium,title:'Appium'},
                {id:3,name:manual,title:'Manual'},
                {id:4,name:oracle,title:'Oracle'},
                {id:5,name:python,title:'Python'},
                {id:6,name:webservices,title:'WebService'},
                {id:7,name:cucumber,title:'Cucumber'}]
        }
    }

    render(){
        return(
            <div className="container">
                <h1>Course</h1>
                <Container>   
                {
                    this.state.images.map(img =>(
                        <Row>
                            <Col>
                                <Card  key={img.id} style={{ width: '18rem' }}>
                                    <Card.Img variant="top" src={img.name}/>
                                    <Card.Body>
                                        <span className="title">{img.title}</span>
                                    </Card.Body>
                                </Card>   
                            </Col>
                            <Col>
                                2
                            </Col>
                            <Col>
                                3
                            </Col>
                        </Row>                     
                    ))
                }
                </Container>
            </div>
        )
    }
}
export default Course;
